import React from "react";

import ProductDetail from "./Product";

export default function ProductList(props) {
  const { products } = props;
  const { stock } = props;

  return (
    <div id="products-grid">
      {products.map((products) => {
        <ProductDetail />;
      })}
    </div>
  );
}
